        require(tokenWeightA == 50, 'BLP: INVALID_TOKEN_WEIGHT');
        // swap fee from [0.05% - 10%] step = 0.05%
        require(swapFee >= 5 && swapFee <= 1000 && swapFee % 5 == 0, 'BLP: INVALID_SWAP_FEE');
